import React from "react";
import styled from "styled-components";
import PTPose from "../img/PTPose.gif";

const SlideGroup = styled.div`
  display: flex;
`;

const SlideImg = styled.img`
  width: 300px;
`;

const SlideDesc = styled.div``;

const IMG = styled.img`
  width: 300px;
`;

const Slide = ({ img }) => {
  // return <IMG src={img} />;
  return (
    <SlideGroup>
      <SlideImg />
      <SlideDesc></SlideDesc>
    </SlideGroup>
  );
};

export default Slide;
